import React from 'react';
import { NavLink } from 'react-router-dom';
import web from '../src/images/1.jpg';

const Home = () => {
    return (
        <>
        <Comment 
            title=""
            disc=""
            butLink="/services"
            but="Get Started "
            imgSrc={web}
         />
        </>
    );

}
export default Home;
